么，别人需要我提供什么，一概不清楚。双方能提供对等的价值，那么朋友才有继续交往的条件。 </div><div>   </div><div> 故事“你是砍柴的，他是放羊的，你和他聊了一天，他的养吃饱了，你的柴呢？”对呀，我的柴呢？若是顺着这条思路想下去，那很容易成为一个利己主义者，变成孤家寡人。错误在于这道题是让你从动机入手，而不是分析既成结果。隐含不同动机的聊天，会衍生结果很多种，多换几个角度看。我摘抄了一些人的看法： </div><div>   </div><div> 你是砍柴的，他是放羊的，你和他聊了一天，他的羊吃饱了，你的柴呢？砍柴的陪不起放羊的… </div><div>   </div><div> ——请放弃你的无效社交！当你看到这一点时，你的朋友圈朋友可能少了一半。 </div><div>   </div><div> 你是砍柴的，他是放羊的，你和他聊了一天，如是你学会了放羊技巧，原来羊是这么放的，放羊的人学会了砍柴技能，原来柴要这样砍。 </div><div>   </div><div> ——三人行必有我师，永远保持空杯的状态 </div><div>   </div><div> 你是砍柴的，他是放羊的，你和他聊了一天，他决定把他的羊跟你的柴交换，于是你有了羊，他也有了柴。 </div><div>   </div><div> ——等价交换，不要看不起任何人，天生我才必有用。 </div><div>   </div><div> 你是砍柴的，他是放羊的，你和他聊了一天，他把他买羊的客户介绍给了你，你把你买柴的客户介绍给了他，于是你们各自的生意越做越大。 </div><div>   </div><div> ——资源整合很重要 </div><div>   </div><div> 你是砍柴的，他是放羊的，你和他聊了一天，都觉得干这个挣不了多少钱，决定合作一起开个烤全羊的店，你的柴烤出来的羊很美味，他的羊纯天然的，把全部精力都放在了这个烤羊店里，雇人去放羊砍柴，由于二人经营得当，很快便发展成为了有名的餐饮连锁店，如今店面遍布大江南北！几年后你们公司上市了。 </div><div>   </div><div> ——没有完美的个人，只有完美的团队，合作共赢升级。 </div><div>   </div><div> 你是砍柴的，他是放羊的，你和他闲聊了一天，他的羊吃饱了，但他还是那个放羊人。而你从他口中得知，最近酒楼烤羊的生意很火爆，而烤羊的木柴很讲究，供不应求，于是你不再砍柴继续原来的那种砍柴，而是改成专门开发砍伐烤羊专用柴，后来又雇了些人来种植和砍柴，通过经常与放羊人沟通，了解需求关系的变化，最后在木柴期货市场称霸天下。而他的儿子刚好接替他成为下一代放羊人。 </div><div>   </div><div> ——你眼中的无效社交，也许是因为你没有看到他人眼里的世界。用有创造力的思维去聊天，就改变自己的生活。 </div><div>   </div><div> 砍柴人和放羊人聊天，我们不知道他们聊了什么吗？如果聊天内容没有吸引力，也不会聊一整天。所以，聊天内容也决定了此次交流有没有价值，也就会有不一样的人生态度。 </div><div>   </div><div> 好比夏天某重点高中的中考分数下来了，引来一片家长和孩子的呼天抢地。看似同样的付出同样的努力，却面对着不一样的结果。就像有位家长说得“吐槽是应该的，但不服显然已经无事于补。”静下心来，细细看一遍您也许就会明白。过多的抱怨对于孩子来说，无形中也是一种压力。与其我们在孩子升学的关键时期，做无用的抱怨与吐槽，还不如坐下来与孩子一起商量做好更好的打算！ </div><div>   </div><div> 有的家长会通过这件事和孩子共勉，他说：当务之急是让孩子有学上。最想说的是，结果就是如此，理性对待。找出原因，对以后更有用。字必须写好，就算不好，整体是必须的，没有老师会在乱糟糟的一堆文字中找答案的，扣分就扣了，没地说理去。所以告诉孩子，结果虽然不容易控制，但过程掌握在咱手里，并最终有因果关系的。儿子下半年初三，也有一些小问题，字也不好。与你共勉。面同一件事物，心态不一样，结果就会不一样。 </div><div>   </div><div> 扯得有点远了，每个人都是社会的一员，所以注定离不开和人打交道。懂得的人通过社交游戏升值，不懂的人被靠边站。玩游戏之前一定不能有抱怨心里，与你打交道的每个人都有其自身价值，对你而言只是用得着或用不着。每次谈话前定个目标，你要通过这个人得到哪些信息，有个方向去说话，谈过之后，想想说过的话，选出对自己有用的。有哪些失败之处，下次要避免。敢于认错，推翻自己。才会找到新的出路。 </div><div>   </div><div> 避免给你的朋友贴标签，这样